      {name: "card2", color: "green"},
      {name: "card3", color: "blue"},
      {name: "card4", color: "purple"}
    ]
  }
  render() {
    return (
      <div className="App">
        <h1>Shell Game</h1>
        <Card></Card>
        <Card></Card>
        <Card></Card>
      </div>
    );
  }

}

export default App;

